import './Card.css';
import Item from './Item';
 function Product(props){
    return(
        <Card className="products-c">
        <ProductItem>
            title={props.items[0].title}
            amount={props.items[0].amount}
            date={props.items[0].date}
        </ProductItem>


        </Card>

    );
 }
 export default Product;
